import React, {useState} from "react";
import produtos from "../produtos/produtos.json"
import { ConteinerStyle, ButtonStyle } from "./style";
// import Camisetas from "../camisetas/Camisetas";
// import imagem1 from "../../imagens/alienigena.png"
// import imagem2 from "../../imagens/astronalta.png"
// import imagem3 from "../../imagens/extraterrestre.png"
// import imagem4 from "../../imagens/jupter.png"
// import imagem5 from "../../imagens/lua.png"
// import imagem6 from "../../imagens/marte.png"
// import imagem7 from "../../imagens/mercurio.png"
// import imagem8 from "../../imagens/nave1.png"
// import imagem9 from "../../imagens/nave2.png"
// import imagem10 from "../../imagens/netuno.png"
// import imagem11 from "../../imagens/plutao.png"
// import imagem12 from "../../imagens/terra.png"
// import InputBusca from "../input/InputBusca";





function HomePage (props){
// console.log(props)

    const [busca, setBusca] = useState("")

    const buscar = () => {
        const buscarCamiseta = props.comprar
        console.log(buscarCamiseta)
    }

    return(
        <div>
            <produtos/>
            <InputBusca busca={busca}  setBusca={setBusca}/>
            <ConteinerStyle>
            <Camisetas foto={ <img  src={imagem1} alt="CAMISETA"/>} nome= {"ABDUÇÃO"} valor={"40,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>
            <Camisetas foto={ <img  src={imagem2} alt="CAMISETA"/>} nome= {"ASTRONALTA"} valor={"40,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>
            <Camisetas foto={ <img  src={imagem3} alt="CAMISETA"/>} nome= {"EXTRATERRESTRE"} valor={"40,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>
            <Camisetas foto={ <img  src={imagem4} alt="CAMISETA"/>} nome= {"JUPTER"} valor={"35,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>
            <Camisetas foto={ <img  src={imagem5} alt="CAMISETA"/>} nome= {"LUA"} valor={"35,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/> 
            <Camisetas foto={ <img  src={imagem6} alt="CAMISETA"/>} nome= {"MARTE"} valor={"35,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>        
            <Camisetas foto={ <img  src={imagem7} alt="CAMISETA"/>} nome= {"MERCÚRIO"} valor={"35,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>
            <Camisetas foto={ <img  src={imagem8} alt="CAMISETA"/>} nome= {"NAVE ESPACIAL"} valor={"60,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>    
            <Camisetas foto={ <img  src={imagem9} alt="CAMISETA"/>} nome= {"NAVE ESPACIAL"} valor={"60,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>
            <Camisetas foto={ <img  src={imagem10} alt="CAMISETA"/>} nome= {"NETUNO"} valor={"35,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>
            <Camisetas foto={ <img  src={imagem11} alt="CAMISETA"/>} nome= {"FALECIDO PLUTÃO"} valor={"35,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>    
            <Camisetas foto={ <img  src={imagem12} alt="CAMISETA"/>} nome= {"TERRA"} valor={"35,00"} comprar={<ButtonStyle onClick={buscar}>comprar</ButtonStyle>}/>
      </ConteinerStyle>
        </div>
    )
}

export default HomePage
